DROP TABLE IF EXISTS "cronnable_logs";
CREATE TABLE "cronnable_logs" ("id" INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL  UNIQUE , "cronnable_id" integer NOT NULL , "execution" DATETIME NOT NULL , "result" TEXT, "duration" numeric);
DROP TABLE IF EXISTS "cronnables";
CREATE TABLE "cronnables" ("id" INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL  UNIQUE , "group_id" INTEGER NOT NULL , "url" VARCHAR NOT NULL , "interval" NUMERIC NOT NULL , "attempts" numeric, "last_attempt" DATETIME, "added" datetime DEFAULT CURRENT_TIMESTAMP, "muted" BOOL DEFAULT 0);
DROP TABLE IF EXISTS "groups";
CREATE TABLE "groups" ("id" integer PRIMARY KEY  AUTOINCREMENT  NOT NULL  UNIQUE , "name" VARCHAR NOT NULL  UNIQUE , "added" datetime DEFAULT CURRENT_TIMESTAMP);
CREATE INDEX "cronnable_indices" ON "cronnables" ("id" ASC, "group_id" ASC);
